function initChangeLang(){$(document).ready(function(){actualLang=getSessionLang(),null==actualLang?(pageLang=getBrowserLang(),setSessionLang(pageLang)):pageLang=actualLang,changeLang(pageLang)})}function changeLang(n){langExists(n)?(pageLang=n,setSessionLang(pageLang),$.each($(".translatable"),function(n,e){changeFieldText(e,pageLang)})):console.warn("Trying to go to unexisting language ["+n+"]")}function changeFieldText(n,e){langExists(e)&&(index=getTextIndex(n,e),null!=index&&($.inArray($(n).prop("tagName"),["INPUT","TEXTAREA"])>=0?$(n).attr("placeholder",texts[e][index][$(n).attr("id")]):$(n).text(texts[e][index][$(n).attr("id")])))}function getLangCode(){return getSessionLang()}function langExists(n){return n in texts?!0:(console.warn(n+" language is not in the texts file"),!1)}function getBrowserLang(){var n=navigator.language||navigator.userLanguage;return n.split("-")[0]?(lang=n.split("-")[0].toUpperCase(),langExists(lang)?lang:(console.warn("Hey, you dont have "+lang+" in your file, setting default"),Object.keys(texts)[0])):(console.warn("Cant get browser lang, setting default"),Object.keys(texts)[0])}function getTextIndex(n,e){var t;return $.each(texts[e],function(a){$(n).attr("id")in texts[e][a]&&(t=a)}),null==t?(console.warn("Id "+$(n).attr("id")+" marked as translatable and there is no key in texts file for "+pageLang),null):t}function getSessionLang(){return sessionStorage.getItem(defaultKey)}function setSessionLang(n){sessionStorage.setItem(defaultKey,n)}var pageLang,defaultKey="com.github.turkissh.languajs.pageLang";